import {createActions} from 'redux-actions';
import axios from 'axios';
const actionpost = createActions({
    getDataSuccess: (payload)=>{
        return payload;
    },
    getDataError: (error)=>{
        return error;
    },
    find: (search)=>{
        return search;
    },
    delete: (element)=>{
        axios.post('http://localhost:4000/delete',{
            _id: element
        }).then(e=>{
            return element;
        }).catch(e=>{
            return ''
        });
    }
})
export default actionpost
